(function() {
  jQuery(document).on('turbolinks:load', function() {
    var messages, messages_to_bottom;
    messages = $('#conversation-body');
    if (messages.length > 0) {
      messages_to_bottom = function() {
        return messages.scrollTop(messages.prop("scrollHeight"));
      };
      return messages_to_bottom();
    }
  });

  jQuery(document).on('init:users_select', function() {
    return $('.users_select').select2({
      width: '100%',
      placeholder: 'Search user',
      ajax: {
        url: '/users/search',
        dataType: 'json',
        quietMillis: 100,
        data: function(term, page) {
          return {
            q: term
          };
        },
        processResults: function(data, page) {
          return {
            results: $.map(data.users || [], function(item) {
              return {
                text: item.email,
                slug: item.name,
                id: item.id
              };
            })
          };
        }
      },
      formatResult: function(user) {
        return '<div class=\'select2-user-result\'> <span>' + user.name + '</span><p>' + user.email + ' ' + '</p></div>';
      }
    });
  });

  jQuery(document).on('change', 'select.topESelect', function() {
    $.ajax({
      url: $(this).data('url') + '?type=' + this.value,
      type: 'GET',
      contentType: 'script',
      processData: false
    });
  });

}).call(this);
