(function() {
  App.conversation = App.cable.subscriptions.create('ConversationChannel', {
    connected: function() {},
    disconnected: function() {},
    received: function(data) {
      var chat_area, conversation, height, list, member_list;
      chat_area = $('.chat_area');
      member_list = $('[data-conversation-member=\'' + data['conversation_id'] + '\']');
      conversation = chat_area.find('[data-conversation-id=\'' + data['conversation_id'] + '\']');
      if (conversation.length === 0) {

      } else {
        if (member_list.length) {
          $('#member_list ul').find(member_list).remove();
        }
        list = '<li class=\'left clearfix\' data-conversation-member= ' + data['conversation_id'] + ' >';
        $('#member_list ul').prepend(list);
        member_list = $('[data-conversation-member=\'' + data['conversation_id'] + '\']');
        conversation.append(data['template']);
        member_list.html(data['conversation_template']);
        height = chat_area[0].scrollHeight;
        chat_area.scrollTop(height);
      }
    },
    speak: function(personal_message) {
      return this.perform('speak', {
        personal_message: personal_message
      });
    }
  });

  $(document).on('submit', '.new_message', function(e) {
    var values;
    e.preventDefault();
    values = $(this).serializeArray();
    App.conversation.speak(values);
    $(this).trigger('reset');
  });

}).call(this);
(function() {
  App.notifications = App.cable.subscriptions.create("NotificationChannel", {
    connected: function() {},
    disconnected: function() {},
    received: function(data) {
      $('#notificationList').prepend("" + data.notification);
      return this.update_counter(data.counter);
    },
    update_counter: function(counter) {
      var $counter, val;
      $counter = $('#notification-counter');
      val = parseInt($counter.text());
      val++;
      return $counter.css({
        opacity: 0
      }).text(val).css({
        top: '-10px'
      }).transition({
        top: '-2px',
        opacity: 1
      });
    }
  });

}).call(this);
$(document).ready(function () {
    $('a.load-more').click(function (e) {
        e.preventDefault();
        $('.load-more').hide();
        $('.loading-gif').show();

        var last_id = $('.category').last().attr('data-id');

        $.ajax({

            type: "GET",
            url: $(this).attr('href'),
            data: {
                id: last_id
            },
            dataType: "script",

            success: function () {
                $('.loading-gif').hide();
                $('.load-more').show();
            }
        });

    });
});
